import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Topuppointshop.css';


function Topuppointshop() {


    return (
        <div className="topup-page">
            <nav class="navbar navbar-light bg-light justify-content-between">
                <Link to="/calculate-point-shop"  ><i className="fas fa-angle-left"><a className="bl">ย้อนกลับ</a></i></Link>
            </nav>

            <div className='topuppoint'>

                <h1>เติมคะแนน</h1>


                <label>กรอกจำนวนคะแนนที่ต้องการ (เงื่อนไขเติมได้ครั้งละ 1000)</label>
                <input
                    type="text"
                />
                <button >ยืนยัน</button>

            </div>



        </div>

    );
}
export default Topuppointshop;
